INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(34864, '1', '1', 'Everyone keep calm! We are controlling the situation.', '12', '0', '100', '0', '0', '0', ''),
(34864, '1', '2', 'Gate is closed. Order from Prince Liam!', '12', '0', '100', '0', '0', '0', ''),
(34864, '1', '3', 'In the woods is something strange going on, and to go beyond the city is unsafe.', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(44086, '1', '1', 'You can\'t do this to us!', '12', '0', '100', '0', '0', '0', ''),
(44086, '1', '2', 'What\'s going on? I think I saw something on the roof.', '12', '0', '100', '0', '0', '0', ''),
(44086, '1', '3', 'My children stayed in Wuthering Heights, quite alone! I shall return to them!', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(34850, '1', '0', 'Stand ready, guards! We don\'t know how many intruders we\'re dealing with, but the Headlands are overrun and we\'re cut off from the harbor towns. Expect to be outnumbered.', '12', '0', '100', '0', '0', '19614', ''),
(34850, '2', '0', 'I want the perimeter secured and the gates manned by two guards at all times. No one gets in, no one gets out.', '12', '0', '100', '0', '0', '19615', ''),
(34850, '3', '0', 'We protected Gilneas from the Scourge. We protected Gilneas during the Northgate rebellion. We will protect Gilneas from whatever this new threat may be.', '12', '0', '100', '0', '0', '19616', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(34851, '1', '0', 'What... what are those things on the rooftops?', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(34913, '1', '1', 'Stand your ground, men!', '14', '0', '100', '0', '0', '19617', ''),
(34913, '1', '2', 'Defeat these foul beasts!', '14', '0', '100', '0', '0', '19618', ''),
(34913, '1', '3', 'Protect the civilians!', '14', '0', '100', '0', '0', '19619', ''),
(34913, '1', '4', 'Push them back!', '14', '0', '100', '0', '0', '19620', ''),
(34913, '1', '5', 'Take heart, men! We must protect our city!', '14', '0', '100', '0', '0', '19621', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35118, '1', '0', '%s becomes enraged!', '16', '0', '100', '0', '0', '0', 'Bloodfang Worgen - combat Enrage');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35874, '1', '0', 'Wonderfully! Now take your gun and make a few holes in wretched asses of these beasts!', '12', '0', '100', '25', '0', '0', ''),
(35874, '2', '0', 'Seems now the healthiest worgen trophy belongs to you!', '12', '0', '100', '11', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35869, '1', '0', 'You need to learn to use Immolate. This spell is perfect to burn the wretched souls of our enemies. Go and give them Immolate!', '12', '0', '100', '25', '0', '0', ''),
(35869, '2', '0', 'Very well! Even here I smell stink of burning skunk...', '12', '0', '100', '11', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35871, '1', '0', 'Now is the time to learn Eviscerate... Will be very good if you go and test the new skill on the worgens.', '12', '0', '100', '25', '0', '0', ''),
(35871, '2', '0', 'I see you\'ve butchered several filthy dogs?', '12', '0', '100', '11', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35870, '1', '0', 'These guards risked their own lives to save our people. Your duty is to touch them by the hand of healing Light!', '12', '0', '100', '0', '0', '0', ''),
(35870, '2', '0', 'You made a good deed $n. Now the guards life is not in danger.', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35873, '1', '0', 'Unleash the power of Rejuvenating Touch and grant it to the wounded guards, who risked their lives, to beat off worgen attacks on civilians!', '12', '0', '100', '0', '0', '0', ''),
(35873, '2', '0', 'Blessing of the land has touched guards ...', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35872, '1', '0', 'It is time to grasp new knowledge. Learn Arcane Missiles and run them in those wretched assholes!', '12', '0', '100', '0', '0', '0', ''),
(35872, '2', '0', 'Perfect! Worgen now will think twice before attacking us.', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35839, '1', '0', 'We are warriors that must bravely defend our land and people, during this difficult times. Learn Charge and show these assholes your willingness to fight till the end', '12', '0', '100', '0', '0', '0', ''),
(35839, '2', '0', 'You have broken the shaggy beasts! Fight as well. May the Force be with you!', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35112, '1', '0', 'Enough! I\'ve made up my mind. We need Crowley on our side.', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35115, '1', '0', 'We ought to leave Crowley in prison with those beasts!', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35369, '1', '1', 'I can\'t fight it!', '14', '0', '100', '0', '0', '0', ''),
(35369, '1', '2', 'Make it stop!', '14', '0', '100', '0', '0', '0', ''),
(35369, '1', '3', 'My face! What\'s wrong with my face!', '14', '0', '100', '0', '0', '0', ''),
(35369, '1', '4', 'My hands... don\'t look at my hands!!', '14', '0', '100', '0', '0', '0', ''),
(35369, '1', '5', 'The pain is unbearable!', '14', '0', '100', '0', '0', '0', ''),
(35369, '1', '6', 'What\'s wrong with me??!', '14', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35378, '1', '0', 'This mastiff will help you find the hidden worgen.', '12', '0', '100', '0', '0', '19696', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35550, '1', '1', 'Fire!', '14', '0', '100', '0', '0', '0', ''),
(35550, '1', '2', 'Keep them back!', '14', '0', '100', '0', '0', '0', ''),
(35550, '1', '3', 'Hold the barricades! Do not give them an inch!', '14', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35753, '1', '0', 'Help! Up here!', '14', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35906, '1', '0', 'We\'ve got Aranas! Fire at will!', '14', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(50474, '1', '1', 'Don\'t look in their eyes! They are not the people whom you once knew!', '14', '0', '100', '0', '0', '0', ''),
(50474, '1', '2', 'Push them back! We must protect the survivors!', '14', '0', '100', '0', '0', '0', ''),
(50474, '1', '3', 'They turn our people into MONSTERS!', '14', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35911, '1', '0', 'If we can make it past the gates into Duskhaven we\'ll be safe. The eastern mountains are virtually impassable.', '12', '0', '100', '0', '0', '19719', ''),
(35911, '2', '0', 'We were fools to take up arms against each other, Darius. The worgen would\'ve never stood a chance.', '12', '0', '100', '0', '0', '19720', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35551, '1', '0', 'I\'ll stay behind with the Royal Guard, father. It is my duty to Gilneas.', '12', '0', '100', '0', '0', '19622', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(35552, '1', '0', 'We need to keep the worgen\'s attention in the city, Genn. It\'s the only shot we have for the survivors to make it to Duskhaven.', '12', '0', '100', '0', '0', '19507', ''),
(35552, '2', '0', 'Not a chance, boy. Gilneas is going to need its king\'s undivided attention. Can\'t have your father wondering whether his child is alive or not.', '12', '0', '100', '0', '0', '19508', ''),
(35552, '3', '0', 'My men and I will hole up inside the Light\'s Dawn Cathedral. I\'ve already given the order and the cannons are on their way. Lead our people well, Genn.', '12', '0', '100', '0', '0', '19509', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36231, '1', '1', 'GAH!!!! I CAN\'T SEE IN HERE!!!!', '12', '0', '100', '0', '0', '20908', 'Horrid Abomination'),
(36231, '1', '2', 'Barrel smell like gunpowder...', '12', '0', '100', '0', '0', '20909', 'Horrid Abomination'),
(36231, '1', '3', 'This not be good...', '12', '0', '100', '0', '0', '20910', 'Horrid Abomination'),
(36231, '1', '4', 'Uh-oh... this gonna hurts me...', '12', '0', '100', '0', '0', '20911', 'Horrid Abomination'),
(36231, '1', '5', 'I gots bad feeling...', '12', '0', '100', '0', '0', '20912', 'Horrid Abomination'),
(36231, '1', '6', 'Get back here! I smashes you!', '12', '0', '100', '0', '0', '20913', 'Horrid Abomination');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36288, '1', '0', 'Are you one of the good worgen, $g mister:ma\'am;? Did you see Cynthia hiding in the sheds outside?', '12', '0', '100', '0', '0', '0', 'Ashley');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36287, '1', '0', 'You are scary! I just want my mommy!', '12', '0', '100', '0', '0', '0', 'Cynthia');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36289, '1', '0', 'Don\'t hurt me! I was just looking for my sisters! I think Ashley\'s inside that house!', '12', '0', '100', '0', '0', '0', 'James');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36440, '1', '1', 'Thank you... *gasp* I owe you my life.', '12', '0', '100', '0', '0', '0', 'Drowning Watchman'),
(36440, '1', '2', 'The land gave way from under our feet... I thought I was dead. I owe you one.', '12', '0', '100', '0', '0', '0', 'Drowning Watchman'),
(36440, '1', '3', 'I... I thought I was a goner. Thanks.', '12', '0', '100', '0', '0', '0', 'Drowning Watchman');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36458, '1', '0', 'You do not mess with my kitty you son of a mongrel!', '14', '0', '100', '0', '0', '0', 'Grandma Wahl');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37065, '1', '0', 'Just in time, $n. Here come the Forsaken.', '12', '0', '100', '0', '0', '19605', 'Prince Liam Greymane'),
(37065, '2', '0', 'You will come no further, Forsaken scum! By the war banner of the ancient Greymane clan, I expel you from our ancestral lands!', '14', '0', '100', '0', '0', '19606', 'Prince Liam Greymane');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37067, '1', '1', 'I wasn\'t ready to die in a marsh. Thanks again!', '12', '0', '100', '0', '0', '0', ''),
(37067, '1', '2', 'Let\'s get out of this marsh!', '12', '0', '100', '0', '0', '0', ''),
(37067, '1', '3', 'Time to run!', '12', '0', '100', '0', '0', '0', ''),
(37067, '1', '4', 'You got here just in time. Thanks!', '12', '0', '100', '0', '0', '0', '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36294, '1', '0', 'Who dares to touch Koroth\'s banner!?', '14', '0', '100', '0', '0', '0', 'Koroth the Hillbreaker'),
(36294, '2', '0', 'You puny thief! Koroth find you! Koroth smash your face in!', '14', '0', '100', '0', '0', '0', 'Koroth the Hillbreaker');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(36814, '1', '0', 'Let the Scythe unbind that which was not meant to be bound! Let the soul master the beast, lest the beast master the soul!', '12', '0', '100', '1', '0', '0', 'Talran of the Wild');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37195, '1', '0', 'Get our men in position immediately, Tobias. We cannot let the Scythe fall into the hands of the Forsaken!!', '12', '0', '100', '53', '0', '0', 'Lord Darius Crowley'),
(37195, '2', '0', 'Lorna!', '14', '0', '100', '0', '0', '19511', 'Lord Darius Crowley'),
(37195, '3', '0', 'Does this toad speak for you, Genn? Do you come to our dwelling as a friend? Or do you come as a tyrant?', '14', '0', '100', '0', '0', '19510', 'Lord Darius Crowley'),
(37195, '4', '0', 'Aye, Genn. It is not law that binds us. It is something far stronger. My men are ready to give their lives under your command.', '12', '0', '100', '0', '0', '19512', 'Lord Darius Crowley');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37870, '1', '0', 'Just as Goldrinn\'s spirit once blessed our druids, let $n be blessed with the wisdom of his race and the ferocity of the wolf god.', '12', '0', '100', '1', '0', '0', 'Lyros Swiftwind');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37873, '1', '0', 'Just as Daral\'nir soothes the cursed druids who gave into the beast and abandoned balance, let Tal\'doren soothe $n.', '12', '0', '100', '1', '0', '0', 'Vassandra Stormclaw');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37876, '1', '0', 'It\'s over Godfrey. You have no support left among the eastern lords.', '12', '0', '100', '1', '0', '0', 'King Genn Greymane');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37875, '1', '0', 'No... I\'d sooner die than have one of your kind for a king!', '12', '0', '100', '0', '0', '19631', 'Lord Godfrey');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(38553, '1', '0', 'It\'s time to join the fray, $n! With you on our side the scales will surely tip in our favor!', '14', '0', '100', '0', '0', '0', 'Krennan Aranas');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(37694, '1', '1', 'It\'s true then? Even those afflicted by the Curse are fighting the Forsaken!', '12', '0', '100', '0', '0', '0', 'Enslaved Villager'),
(37694, '1', '2', 'Thank you!', '12', '0', '100', '0', '0', '0', 'Enslaved Villager'),
(37694, '1', '3', 'The Forsaken will pay for what they\'ve done!', '12', '0', '100', '0', '0', '0', 'Enslaved Villager');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(38617, '1', '0', 'Make sure everything is ready. The orcs\' emissary is ready to meet Sylvanas inside the cathedral.', '14', '0', '100', '1', '0', '0', 'Forsaken General');
